import React from "react";
import "./about.css";
import AboutDesktop from "./components/AboutDesktop";

function AboutComponent(props) {
  return (
    <section ref={props.AboutRef} className="about-component page">
      <AboutDesktop/>
    </section>
  );
}

export default AboutComponent;
